  const [datas, setDatas] = useState([
    {
      title: 'Site et application',
      value: 60
    },
    {
      title: 'Application bureau',
      value: 60
    },
    {
      title: 'Application mobile',
      value: 60
    },
    {
      title: 'Design interface',
      value: 60
    }
  ])
    return (
        <div>
          {
            datas?.map(({ title, value }, i) => {
              return <div key={i}>          
                <Block 
                  title=""
                />
                </div>
            })
          }
            <p>Body</p>

        </div>
    )
}

export default Competences
